Iarrfaidh an chéad chuid den chlár cluiche buille faoi thuairim ionchur úsáideora, próiseas an t-ionchur sin, agus seiceáil go bhfuil an t-ionchur san fhoirm a bhfuiltear ag súil léi. Chun tús a chur, déanfaimid lig don imreoir buille faoi thuairim a ionchur. Cuir isteach an cód i Liostú 2-1 isteach src/main.rs . use std::io; fn main() { println!("Guess the number!"); println!("Please input your guess."); let mut guess = String::new(); io::stdin() .read_line(&mut guess) .expect("Failed to read line"); println!("You guessed: {}", guess);
} Tá go leor faisnéise sa chód seo, mar sin déanaimis dul thairis air líne ar líne. Chuig ionchur úsáideora a fháil agus ansin an toradh a phriontáil mar aschur, ní mór dúinn an leabharlann ionchuir/aschuir io isteach sa scóip. Tagann an leabharlann io ón gcaighdeán leabharlann, ar a dtugtar std: use std::io;
# # fn main() {
# println!("Guess the number!");
