# # let mut guess = String::new();
# # io::stdin()
# .read_line(&mut guess)
# .expect("Failed to read line");
# # println!("You guessed: {}", guess);
# } De réir réamhshocraithe, tá sraith míreanna sainithe ag Rust sa leabharlann chaighdeánach atá aige a thugann isteach raon feidhme gach cláir. Tugtar an prelude ar an tacar seo, agus is féidir leat gach rud atá ann a fheiceáil i gcáipéisíocht chaighdeánach na leabharlainne . Mura bhfuil cineál is mian leat a úsáid sa réamhrá, caithfidh tú an cineál sin a thabhairt leat isteach sa raon feidhme go sainráite le ráiteas use. Ag baint úsáide as an leabharlann std::io ar fáil duit le roinnt gnéithe úsáideacha, lena n-áirítear an cumas chun glacadh leis ionchur úsáideora. Mar a chonaic tú i gCaibidil 1, is é an fheidhm main an pointe iontrála isteach sa clár: # use std::io;
