Ansin, cruthóimid athraitheach chun ionchur an úsáideora a stóráil, mar seo: # use std::io;
# # fn main() {
# println!("Guess the number!");
# # println!("Please input your guess.");
# let mut guess = String::new();
# # io::stdin()
# .read_line(&mut guess)
# .expect("Failed to read line");
# # println!("You guessed: {}", guess);
# } Anois tá an clár ag éirí suimiúil! Tá go leor ar siúl sa bheagán seo líne. Bainimid úsáid as an ráiteas let chun an athróg a chruthú. Seo sampla eile: let úlla = 5; Cruthaíonn an líne seo athróg nua darb ainm apples agus ceanglaíonn sí é leis an luach 5. In Meirge, tá athróga do-mharú de réir réamhshocraithe, rud a chiallaíonn nuair a thugaimid an athróg a luach, ní athróidh an luach. Beidh an coincheap seo á phlé againn go mion an [“Athróga agus Comhshócmhainneacht”][athróga-agus-shó-shó-athróga] alt i gCaibidil 3. Chun athróg mutable a dhéanamh, cuirimid mut roimh an ainm athróg: let úlla = 5; // do-athraithe
let bananaí mut = 5; // inathraithe Nóta: Tosaíonn an chomhréir // trácht a leanann go dtí deireadh an líne. Déanann Rust neamhaird ar gach rud i dtuairimí. Déanfaimid trácht níos mó a phlé sonraí i [Caibidil 3][tráchtanna] . Ag filleadh ar an gclár cluiche buille faoi thuairim, tá a fhios agat anois go mbeidh let mut guess athróg chomhshóite a thabhairt isteach darb ainm guess. Insíonn an comhartha comhionann (=) Rust dúinn ag iarraidh rud éigin a cheangal leis an athróg anois. Ar thaobh na láimhe deise den chomhartha comhionann an luach atá faoi cheangal ag guess, atá mar thoradh ar ghlaoch String::new, feidhm a thugann sampla nua de String ar ais. [String][teaghrán] Is cineál teaghrán é a sholáthraíonn an caighdeán leabharlann atá ina giotán téacs ionchódaithe UTF-8 infhás. Léiríonn an chomhréir :: sa líne ::new go bhfuil baint ag new feidhm den chineál String. Feidhm ghaolmhar is ea feidhm atá curtha i bhfeidhm ar chineál, sa chás seo String. Cruthaíonn an fheidhm new seo a teaghrán nua, folamh. Gheobhaidh tú feidhm new ar go leor cineálacha toisc gur a ainm coitianta ar fheidhm a dhéanann luach nua de shaghas éigin. Ina hiomláine, chruthaigh an líne let mut guess = String::new(); mutable athróg atá ceangailte faoi láthair le sampla nua, folamh de String. Tá sin réidh!

