Thabhairt chun cuimhne gur chuimsigh muid an fheidhmiúlacht ionchuir/aschuir ón gcaighdeán leabharlann le use std::io; ar an gcéad líne den chlár. Anois cuirfimid glaoch an fheidhm stdin ón modúl io, a ligfidh dúinn úsáideoir a láimhseáil ionchur: # use std::io;
# # fn main() {
# println!("Guess the number!");
# # println!("Please input your guess.");
# # let mut guess = String::new();
# io::stdin() .read_line(&mut guess)
# .expect("Failed to read line");
# # println!("You guessed: {}", guess);
# } Murar iompórtáladh muid an leabharlann io le use std::io; ag tús na an chláir, d'fhéadfaimis an fheidhm a úsáid fós tríd an nglao feidhme seo a scríobh mar std::io::stdin. Tugann an fheidhm stdin sampla de std::io::Stdin , ar cineál é a sheasann do láimhseáil go dtí an t-ionchur caighdeánach do do teirminéal. Ansin, glaonn an líne .read_line(&mut guess) ar read_line modh ar an láimhseáil ionchur caighdeánach chun ionchur a fháil ón úsáideoir. Tá &mut guess á rith againn freisin mar argóint chun read_line a insint cad é teaghrán chun ionchur an úsáideora a stóráil. Is é an jab iomlán de read_line a ghlacadh is cuma cad iad na cineálacha úsáideora isteach i ionchur caighdeánach agus cuir é sin i sreangán (gan a bhfuil ann a fhorscríobh), mar sin cuirimid an teaghrán sin ar aghaidh mar argóint. Ní mór an argóint téad a bheith mutable ionas gur féidir an modh a athrú ábhar an téad. Léiríonn an & gur reference atá san argóint seo, rud a thugann bealach duit lig do chodanna iolracha de do chód rochtain a fháil ar phíosa amháin sonraí gan gá a dhéanamh na sonraí sin a chóipeáil isteach i gcuimhne arís agus arís eile. Is gné chasta iad tagairtí, agus ceann de mhórbhuntáistí Rust ná cé chomh sábháilte agus éasca é a úsáid tagairtí. Ní gá go mbeadh a lán de na sonraí sin ar eolas agat chun é seo a chríochnú clár. Faoi láthair, níl a fhios agat ach, cosúil le hathróga, is tagairtí iad immutable de réir réamhshocraithe. Mar sin, ní mór duit &mut guess a scríobh seachas &guess chun é a dhéanamh mutable. (Míneoidh Caibidil 4 tagairtí níos mó go críochnúil.)

