Táimid fós ag obair ar an líne cód seo. Tá an tríú líne á phlé againn anois téacs, ach tabhair faoi deara go bhfuil sé fós mar chuid de líne chóid loighciúil amháin. An chéad cheann eile Is cuid den mhodh seo: # use std::io;
# # fn main() {
# println!("Guess the number!");
# # println!("Please input your guess.");
# # let mut guess = String::new();
# # io::stdin()
# .read_line(&mut guess) .expect("Failed to read line");
# # println!("You guessed: {}", guess);
# } D’fhéadfaimis an cód seo a scríobh mar: io::stdin().read_line(&mut guess).expect("Failed to read line"); Is deacair líne fhada amháin a léamh, áfach, mar sin is fearr í a roinnt. Tá sé Is minic a bhíonn sé ciallmhar líne nua agus spás bán eile a thabhairt isteach chun cabhrú le briseadh fada línte nuair a ghlaonn tú ar mhodh leis an gcomhréir .method_name(). Anois déanaimis pléigh cad a dhéanann an líne seo. Mar a luadh cheana, cuireann read_line cibé rud a chuireann an t-úsáideoir isteach sa teaghrán tugaimid air, ach tugann sé luach Result ar ais freisin. Result is enumeration , ar a dtugtar enum go minic, atá cineál is féidir a bheith i gceann de na stáit iolracha. Glaoimid ar gach ceann acu b'fhéidir luaigh variant . Caibidil 6 Clúdóidh enums níos mine. An cuspóir de na cineálacha Result seo is ea faisnéis láimhseála earráidí a ionchódú. Is iad na leaganacha Result ná Ok agus Err. Léiríonn an leagan Ok an D'éirigh leis an oibríocht, agus tá an luach a ghintear go rathúil ann. Ciallaíonn an leagan Err gur theip ar an oibríocht, agus tá faisnéis ann faoi ​​conas nó cén fáth ar theip ar an oibríocht. Tá modhanna sainmhínithe ar luachanna an chineáil Result, cosúil le luachanna d'aon chineál leo. Mar shampla de Result tá expect method gur féidir leat glaoch. Más luach Err é an t-úsáír seo de Result, expect a chur faoi deara an clár a tuairteála agus a thaispeáint ar an teachtaireacht a rith tú mar argóint le expect. Má thugann an modh read_line Err ar ais, dhéanfadh sé is dócha go bhfuil sé mar thoradh ar earráid a tháinig ón gcóras oibriúcháin bunúsach. Más luach Ok é an t-úsaid seo de Result, glacfaidh expect an tuairisceán an luach atá ag Ok agus cuir an luach sin ar ais chugat ionas gur féidir leat é a úsáid. Sa chás seo, is é an luach sin líon na mbeart in ionchur an úsáideora. Mura nglaoann tú ‘ag súil’, tiomsóidh an clár, ach gheobhaidh tú rabhadh: $ cargo build Compiling guessing_game v0.1.0 (file:///projects/guessing_game)
warning: unused `Result` that must be used --> src/main.rs:10:5 |
10 | io::stdin().read_line(&mut guess); | ^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^^ | = note: this `Result` may be an `Err` variant, which should be handled = note: `#[warn(unused_must_use)]` on by default
help: use `let _ = ...` to ignore the resulting value |
10 | let _ = io::stdin().read_line(&mut guess); | +++++++ warning: `guessing_game` (bin "guessing_game") generated 1 warning Finished `dev` profile [unoptimized + debuginfo] target(s) in 0.59s Tugann Rust foláireamh nár úsáid tú an luach Result a fuarthas ar ais ó read_line, ag tabhairt le fios nár láimhseáladh an clár earráid fhéideartha. Is é an bealach ceart chun an rabhadh a chosc ná cód láimhseála earráidí a scríobh, ach inár gcás ba mhaith linn ach a tuairteála an clár seo nuair a tharlaíonn fadhb, mar sin againn is féidir expect a úsáid. Foghlaimeoidh tú faoi earráidí a athshlánú i Caibidil 9 .

