# } Priontálann an líne seo an teaghrán ina bhfuil ionchur an úsáideora anois. An tacar {} de lúibíní curly is a placeholder: smaoineamh ar {} as little crab pincers that hold luach i bhfeidhm. Nuair a bhíonn luach athróige á phriontáil, is féidir leis an ainm athróg dul taobh istigh de na lúibíní curly. Nuair a phriontáil an toradh ar mheastóireacht ar abairt, cuir lúibíní chatach folamh sa teaghrán formáid, ansin lean an teaghrán formáide le liosta slonn scartha le camóg le priontáil i ngach folamh lúibín curly placeholder san ord céanna. Athróg a phriontáil agus an toradh de shloinneadh in aon ghlao amháin chun println! a bheadh ​​mar seo: let x = 5;
let y = 10; println!("x = {x} and y + 2 = {}", y + 2); Phriontálfadh an cód seo x = 5 agus y + 2 = 12.

