Anois go bhfuil ionchur úsáideora agus uimhir randamach againn, is féidir linn iad a chur i gcomparáid. An chéim sin léirithe i Liostú 2-4. Tabhair faoi deara nach mbeidh an cód seo le chéile go fóill, mar a dhéanfaimid mínigh. use rand::Rng;
use std::cmp::Ordering;
use std::io; fn main() { // --snip--
# println!("Guess the number!");
# # let secret_number = rand::thread_rng().gen_range(1..=100);
# # println!("The secret number is: {secret_number}");
# # println!("Please input your guess.");
# # let mut guess = String::new();
# # io::stdin()
# .read_line(&mut guess)
# .expect("Failed to read line"); println!("You guessed: {guess}"); match guess.cmp(&secret_number) { Ordering::Less => println!("Too small!"), Ordering::Greater => println!("Too big!"), Ordering::Equal => println!("You win!"), }
} Ar dtús cuirimid ráiteas use eile leis, ag tabhairt cineál ar a dtugtar std::cmp::Orderingisteach sa raon feidhme ón leabharlann chaighdeánach. An cineál Ordering Is enum eile é agus tá na leaganacha Less, Greater, agus Equal ann. Is iad seo na trí thoradh is féidir nuair a dhéanann tú comparáid idir dhá luach. Ansin cuirimid cúig líne nua ag bun a úsáideann an cineál Ordering. Tá an Déanann modh cmp dhá luach i gcomparáid agus is féidir glaoch a chur air ar aon rud is féidir i gcomparáid. Déanann sé tagairt do cibé rud is mian leat a chur i gcomparáid leis: seo é comparáid a dhéanamh idir guess agus secret_number. Ansin filleann sé leagan de na ‘Ordú’ enum thugamar isteach scóip leis an ráiteas ‘úsáide’. Úsáidimid a match slonn le socrú cad é an chéad rud eile le déanamh bunaithe air cén leagan de Ordering a cuireadh ar ais ón nglao go cmp leis na luachanna in guess agus secret_number. Tá slonn match comhdhéanta de arms . Is éard atá i lámh ná pattern to mheaitseáil i gcoinne, agus an cód ba chóir a rith má tá an luach a thugtar do match oireann patrún na láimhe sin. Glacann meirge an luach a thugtar do match agus cuma trí phatrún gach lámh ar a seal. Is iad patrúin agus an tógáil match gnéithe cumhachtacha meirge: ligeann siad duit do chód a chur in iúl ar chásanna éagsúla d'fhéadfadh teacht trasna orthu agus déanann siad cinnte go láimhseálann tú iad go léir. Beidh na gnéithe seo clúdaithe go mion i gCaibidil 6 agus i gCaibidil 19, faoi seach. Siúlfaimid trí shampla leis an slonn match a úsáidimid anseo. Abair é sin tá buille faoi thuairim ag an úsáideoir 50 agus is é an uimhir rúnda a ghintear go randamach an uair seo 38. Nuair a chuirtear an cód i gcomparáid le 50 go 38, fillfidh an modh cmp Ordering::Greater toisc go bhfuil 50 níos mó ná 38. Faigheann an slonn match an luach Ordering::Greater agus tosaíonn sé ag seiceáil patrún gach lámh. Breathnaíonn sé ag patrún an chéad lámh, Ordering::Less, agus feiceann sé go bhfuil an luach Ní hionann Ordering::Greater le Ordering::Less, mar sin déanann sé neamhaird den chód i an lámh sin agus a ghluaiseann go dtí an chéad lámh eile. Is é patrún an chéad lámh eile Ordering::Greater, a dhéanann mar a chéile le Ordering::Greater! An gaolmhar déanfar cód sa lámh sin a fhorghníomhú agus a phriontáil Too big! ar an scáileán. An match críochnaíonn an abairt tar éis an chéad chluiche rathúil, mar sin ní bhreathnóidh sé ar an gceann deireanach lámh sa chás seo. Mar sin féin, ní thiomsóidh an cód i Liostú 2-4 fós. Déanaimis iarracht é: $ cargo build Compiling libc v0.2.86 Compiling getrandom v0.2.2 Compiling cfg-if v1.0.0 Compiling ppv-lite86 v0.2.10 Compiling rand_core v0.6.2 Compiling rand_chacha v0.3.0 Compiling rand v0.8.5 Compiling guessing_game v0.1.0 (file:///projects/guessing_game)
