Is ionann cineál scalar agus luach amháin. Tá ceithre phríomhchineál scálach ag meirge: slánuimhreacha, uimhreacha snámhphointe, Booles, agus carachtair. Seans go n-aithníonn tú iad seo ó theangacha ríomhchlárúcháin eile. Léimid an chaoi a n-oibríonn siad i Rust. Cineálacha Slánuimhir Is uimhir é _ slánuimhir_ gan comhpháirt codánach. D’úsáideamar slánuimhir amháin clóscríobh i gCaibidil 2, an cineál u32. Tugann an dearbhú cineál seo le fios go bhfuil an ba cheart gur slánuimhir gan síniú (cineálacha slánuimhir sínithe a bheadh ​​sa luach a bhaineann leis tosú le i in ionad u) a thógann suas le 32 giotán spáis. Léiríonn Tábla 3-1 na cineálacha slánuimhir ionsuite i Rust. Is féidir linn aon cheann de na leaganacha seo a úsáid chun a dhearbhú an cineál luach slánuimhir. Tábla 3-1: Cineálacha Slánuimhir i Meirge Fad Sínithe Gan síniú 8-giotán i8 u8 16-giotán i16 u16 32-giotán i32 u32 64-giotán i64 u64 128-giotán i128 u128 arch isize usize Is féidir le gach malairt a bheith sínithe nó gan síniú agus tá méid follasach aige. Tagraíonn Signed agus unsigned do cibé an féidir an uimhir a bheith diúltach - i bhfocail eile, cibé an gá comhartha a bheith ag an uimhir (sínithe) nó cibé an mbeidh sé dearfach choíche agus an féidir a bheith mar sin ionadaíocht gan comhartha (gan síniú). Tá sé cosúil le huimhreacha a scríobh ar pháipéar: cathain tá an comhartha tábhachtach, taispeántar uimhir le comhartha móide nó comhartha lúide; áfach, nuair atá sé sábháilte glacadh leis go bhfuil an uimhir deimhneach, taispeántar é gan aon chomhartha. Stóráiltear uimhreacha sínithe trí úsáid a bhaint as dhá chomhlánú ionadaíocht. Is féidir le gach leagan sínithe uimhreacha a stóráil ó -(2n - 1) go 2n - 1 - 1 san áireamh, áit arb é n líon na ngiotán a úsáideann an leagan. Mar sin an Is féidir le i8 uimhreacha a stóráil ó -(27) go 27 - 1, arb ionann é -128 go 127. Is féidir le leaganacha neamhshínithe uimhreacha a stóráil ó 0 go 2n - 1, mar sin is féidir le u8 uimhreacha a stóráil ó 0 go 28 - 1, arb ionann é agus 0 go 255. Ina theannta sin, braitheann na cineálacha isize agus usize ar ailtireacht an ríomhaire a bhfuil do ríomhchlár ar siúl air, atá sonraithe sa tábla mar “áirse”: 64 giotán má tá tú ar ailtireacht 64-giotán agus 32 giotán má tá tú ar 32-giotán ailtireacht. Is féidir leat slánuimhreacha a scríobh in aon cheann de na foirmeacha a thaispeántar i dTábla 3-2. Nóta go gceadaítear iarmhír cineáil i lítir uimhreacha ar féidir a bheith ina gcineálacha iolracha uimhriúla, mar 57u8, chun an cineál a ainmniú. Is féidir le huimhreacha _ a úsáid mar a deighilteoir amhairc chun an uimhir a dhéanamh níos éasca le léamh, mar 1_000, a dhéanfaidh beidh an luach céanna agat agus dá mbeadh 1000 sonraithe agat. Tábla 3-2: Slánuimhir Liteartha i Meirge Uimhreacha litrithe Sampla Deachúil 98_222 Heics 0xff Octal 0o77 Dénártha 0b1111_0000 Beart (u8 amháin) b'A' Mar sin cén chaoi a bhfuil a fhios agat cén cineál slánuimhir atá le húsáid? Mura bhfuil tú cinnte, Rust's is áiteanna maithe iad mainneachtainí de ghnáth le tosú: réamhshocrú cineálacha slánuimhir go i32. Is é an príomhstaid ina n-úsáidfeá isize nó usize agus tú ag innéacsú bailiúchán de shaghas éigin. Sárshreabhadh Slánuimhir Ligean le rá go bhfuil athróg de chineál u8 agat ar féidir leis luachanna a choinneáil idir 0 agus 255. Má dhéanann tú iarracht an athróg a athrú go luach lasmuigh den raon sin, mar 256, tarlóidh integer overflow , agus is féidir ceann amháin de dhá iompar a bheith mar thoradh air. Agus tú ag tiomsú i mód dífhabhtaithe, cuimsíonn Rust seiceálacha le haghaidh ró-shreabhadh slánuimhir a chuireann faoi deara do chlár panic ag am rite má tharlaíonn an t-iompar seo. Meirge úsáideann an téarma panicking nuair a scoireann clár le hearráid; pléifimid scaoll níos doimhne sa “Earráidí Do-aisghabhála le panic!” alt i gCaibidil 9. Agus tú ag tiomsú i mód scaoilte leis an mbratach --release, déanann Rust amhlaidh not seiceálacha a chur san áireamh le haghaidh ró-shreabhadh slánuimhir a bhíonn ina chúis le scaoll. Ina áit sin, más rud é tarlaíonn ró-shreabhadh, feidhmíonn Rust two's compliment wrapping . I mbeagán focal, luachanna níos mó ná an t-uasluach is féidir leis an gcineál “timfhilleadh” a choinneáil chomh híseal agus is féidir de na luachanna is féidir leis an gcineál a choinneáil. I gcás u8, déantar an luach 256 0, éiríonn an luach 257 1, agus mar sin de. Ní bheidh an clár scanraithe, ach beidh an beidh luach ag an athróg is dócha nach é an luach a raibh tú ag súil leis bhfuil. Meastar gur earráid é a bheith ag brath ar iompar fillte an tslánuimhir thar maoil. Chun an fhéidearthacht ró-shreabhadh a láimhseáil go sainráite, is féidir leat na teaghlaigh seo a úsáid modhanna a sholáthraíonn an leabharlann chaighdeánach do chineálacha uimhriúla primitive: Wrap i ngach modh leis na modhanna wrapping_*, mar shampla wrapping_add. Tabhair ar ais an luach None má tá cur thar maoil leis na modhanna checked_*. Tabhair ar ais an luach agus Boole ag cur in iúl an raibh cur thar maoil le na modhanna overflowing_*. Sáithithe ag íosluachanna nó uasluachanna an luacha leis an saturating_* modhanna. Cineálacha Snámhphointe Tá dhá chineál primitive ag Rust freisin le haghaidh floating-point numbers , is iad sin uimhreacha le pointí deachúla. Is iad cineálacha snámhphointe meirge ná f32 agus f64, atá 32 giotán agus 64 giotán i méid, faoi seach. Is é an cineál réamhshocraithe f64 mar gheall ar LAPanna nua-aimseartha, tá sé thart ar an luas céanna le f32 ach tá sé in ann níos cruinne. Tá gach cineál snámhphointe sínithe. Seo sampla a thaispeánann uimhreacha snámhphointe i ngníomh: Ainm comhaid: src/main.rs fn main() { let x = 2.0; // f64 let y: f32 = 3.0; // f32
} Léirítear uimhreacha snámhphointe de réir an chaighdeáin IEEE-754. Is snámhphointe aon-chruinneas é an cineál f32, agus tá cruinneas dúbailte ag f64. Oibríochtaí Uimhriúla Tacaíonn Rust leis na hoibríochtaí bunúsacha matamaitice a mbeifeá ag súil leo don uimhir ar fad cineálacha: suimiú, dealú, iolrú, roinnt, agus fuílleach. Slánuimhir teascadh an rannán i dtreo náid go dtí an tslánuimhir is gaire. Léiríonn an cód seo a leanas conas a d’úsáidfeá gach oibríocht uimhriúil i ráiteas let: Ainm comhaid: src/main.rs fn main() { // addition let sum = 5 + 10; // subtraction let difference = 95.5 - 4.3; // multiplication let product = 4 * 30; // division let quotient = 56.7 / 32.2; let truncated = -5 / 3; // Results in -1 // remainder let remainder = 43 % 5;
} Úsáideann gach slonn sna ráitis seo oibreoir matamaitice agus déanann sé meastóireacht go luach aonair, atá ceangailte ansin le hathróg. Aguisín B tá liosta de na hoibreoirí go léir a Rust soláthraíonn. An Cineál Boole Mar atá i bhformhór na dteangacha ríomhchlárúcháin eile, tá dhá fhéidearthacht ag cineál Boole in Rust luachanna: true agus false. Is beart amháin iad Booleans. An cineál Boole i Sonraítear meirge ag baint úsáide as bool. Mar shampla: Filename: src/main.rs fn main() { let t = true; let f: bool = false; // with explicit type annotation
} Is é an príomhbhealach chun luachanna Boole a úsáid ná trí choinníollacha, mar if léiriú. Clúdóimid conas a oibríonn nathanna if i Rust sa “Control Sreabhadh” alt. An Cineál Carachtair Is é an cineál char Rust an cineál aibítre is primitíbhí sa teanga. Seo iad roinnt samplaí de luachanna char a dhearbhú: Ainm comhaid: src/main.rs fn main() { let c = 'z'; let z: char = 'ℤ'; // with explicit type annotation let heart_eyed_cat = '😻';
} Tabhair faoi deara go sonraimid char litriúil le comharthaí athfhriotail singil, seachas teaghrán litriúil, a úsáideann Sleachta dúbailte. Tá cineál char Rust ceithre beart i méid agus Léiríonn Luach Scálar Unicode, rud a chiallaíonn gur féidir leis a lán níos mó a léiriú ná ach ASCII. Litreacha accented; Carachtair na Síne, na Seapáine agus na Cóiré; emoji; agus is luachanna char bailí iad spásanna ar leithead nialasach i Rust. Scálar Unicode Réimníonn luachanna ó U+0000 go U+D7FF agus U+E000 go U+10FFFF san áireamh. Mar sin féin, ní coincheap in Unicode é “carachtar” i ndáiríre, mar sin do dhuine b'fhéidir nach bhfuil an intuiscint maidir le cad is “carachtar” ann ag teacht leis an rud atá i ‘char’ Meirge. Déanfaimid an t-ábhar seo a phlé go mion i “Ag stóráil Téacs Ionchódaithe UTF-8 le Teaghráin” i gCaibidil 8.

