Is féidir le Compound types luachanna iolracha a ghrúpáil i gcineál amháin. Tá dhá cheann ag meirge cineálacha cumaisc primitive: tuples agus eagair. An Cineál Tuple Is bealach ginearálta é A tuple chun líon luachanna a ghrúpáil le chéile le a éagsúlacht cineálacha isteach i gcineál cumaisc amháin. Tá fad seasta ag tuples: uair amháin dearbhaithe, ní féidir leo fás nó crapadh i méid. Cruthaímid tuple trí liosta luachanna atá scartha le camóga a scríobh taobh istigh lúibíní. Tá cineál ag gach seasamh sa tuple, agus cineálacha an ní gá go mbeadh luachanna difriúla sa tuple mar an gcéanna. Chuireamar roghnach leis clóscríobh nótaí sa sampla seo: Ainm comhaid: src/main.rs fn main() { let tup: (i32, f64, u8) = (500, 6.4, 1);
} Ceanglaíonn an athróg tup leis an tuple iomlán toisc go meastar tuple a eilimint cumaisc amháin. Chun na luachanna aonair a bhaint as tuple, is féidir linn bain úsáid as meaitseáil patrún chun luach tuple a scrios, mar seo: Ainm comhaid: src/main.rs fn main() { let tup = (500, 6.4, 1); let (x, y, z) = tup; println!("The value of y is: {y}");
} Cruthaíonn an clár seo tuple ar dtús agus ceanglaíonn sé leis an athróg tup. Tá sé ansin úsáideann patrún le let chun tup a ghlacadh agus é a iompú ina thrí ar leith athróga, x, y, agus z. Tugtar destructuring air seo toisc go mbriseann sé an tuple aonair i dtrí chuid. Ar deireadh, priontaí an clár luach na y, atá 6.4. Is féidir linn eilimint tuple a rochtain go díreach freisin trí úsáid a bhaint as tréimhse (.) ina dhiaidh sin innéacs an luacha ba mhaith linn a rochtain. Mar shampla: Ainm comhaid: src/main.rs fn main() { let x: (i32, f64, u8) = (500, 6.4, 1); let five_hundred = x.0; let six_point_four = x.1; let one = x.2;
} Cruthaíonn an clár seo an x tuple agus ansin rochtain a fháil ar gach eilimint den tuple ag baint úsáide as a n-innéacsanna faoi seach. Mar is amhlaidh le formhór na dteangacha ríomhchlárúcháin, an chéad cheann Is é 0 innéacs i tuple. Tá ainm speisialta ar an tuple gan luachanna, unit . An luach seo agus a tá an dá chineál comhfhreagrach scríofa () agus seasann siad do luach folamh nó luach cineál fillte folamh. Go hintuigthe tugann na habairtí an luach aonaid ar ais mura ndéanann siad aon luach eile a thabhairt ar ais. An Cineál Eagar Bealach eile le bailiúchán illuachanna a bheith agat is ea array . Murab ionann tuple, ní mór go mbeadh an cineál céanna ag gach eilimint d'eagar. Murab ionann agus arrays i roinnt teangacha eile, tá fad seasta ag eagair i Rust. Scríobhaimid na luachanna in eagar mar liosta camóg-scartha taobh istigh de chearnóg lúibíní: Ainm comhaid: src/main.rs fn main() { let a = [1, 2, 3, 4, 5];
} Bíonn eagair úsáideach nuair is mian leat do shonraí a leithdháileadh ar an gcruach, mar a chéile na cineálacha eile atá feicthe againn go dtí seo, seachas an gcarn (beidh muid ag plé na chairn agus an gcarn níos mó i Caibidil 4 ) nó nuair ba mhaith leat a chinntiú go mbíonn líon seasta eilimintí agat i gcónaí. Níl eagar mar solúbtha mar an cineál veicteora, áfach. Is cineál bailiúcháin den chineál céanna é veicteoir ar fáil ag an leabharlann chaighdeánach a is cead chun fás nó crapadh i méid. Más rud é níl tú cinnte cé acu eagar nó veicteoir a úsáid, seans gur cheart duit a veicteoir. Caibidil 8 pléitear veicteoirí níos mine. Mar sin féin, tá arrays níos úsáidí nuair a fhios agat ar líon na n-eilimintí nach mbeidh gá a athrú. Mar shampla, má bhí tú ag baint úsáide as ainmneacha na míosa i ríomhchlár, is dócha go n-úsáidfeá eagar seachas veicteoir mar is eol duit beidh 12 eilimint ann i gcónaí: let míonna = ["Eanáir", "Feabhra", "Márta", "Aibreán", "Bealtaine", "Meitheamh", "Iúil", "Lúnasa", "Meán Fómhair", "Deireadh Fómhair", "Samhain", "Nollaig"]; Scríobhann tú cineál eagar ag baint úsáide as lúibíní cearnacha le cineál gach dúil, leathstad, agus ansin líon na n-eilimintí san eagar, mar seo: let a: [i32; 5] = [1, 2, 3, 4, 5]; Anseo, is é i32 an cineál gach eilimint. Tar éis an leathstad, an uimhir 5 Léiríonn an eagar go bhfuil cúig eilimint. Is féidir leat freisin eagar a thúsú chun an luach céanna a bheith ann do gach eilimint trí ag sonrú an luach tosaigh, agus leathstad ina dhiaidh sin, agus ansin fad an t-eagar idir lúibíní cearnacha, mar a thaispeántar anseo: let a = [3; 5]; San eagar darb ainm a beidh gnéithe 5 a shocrófar ar fad ar an luach 3 ar dtús. Tá sé seo mar an gcéanna le scríobh let a = [3, 3, 3, 3, 3]; ach in a bhealach níos gonta. Rochtain a fháil ar Eilimintí Eagar Is éard atá in eagar ná smután amháin de chuimhne ar mhéid aitheanta seasta agus is féidir a bheith leithroinnte ar an chairn. Is féidir leat teacht ar eilimintí d'eagar trí úsáid a bhaint as innéacsú, mar seo: Ainm comhaid: src/main.rs fn main() { let a = [1, 2, 3, 4, 5]; let first = a[0]; let second = a[1];
} Sa sampla seo, gheobhaidh an athróg darb ainm first an luach 1 mar sin is é an luach ag innéacs [0] san eagar. Gheobhaidh an athróg darb ainm second an luach 2 ón innéacs [1] san eagar. Rochtain Neamhbhailí ar Eilimint Eagar Feicfimid cad a tharlóidh má dhéanann tú iarracht rochtain a fháil ar eilimint d'eagar atá caite deireadh an eagar. Abair go ritheann tú an cód seo, cosúil leis an gcluiche buille faoi thuairim i Caibidil 2, chun innéacs eagair a fháil ón úsáideoir: Ainm comhaid: src/main.rs use std::io; fn main() { let a = [1, 2, 3, 4, 5]; println!("Please enter an array index."); let mut index = String::new(); io::stdin() .read_line(&mut index) .expect("Failed to read line"); let index: usize = index .trim() .parse() .expect("Index entered was not a number"); let element = a[index]; println!("The value of the element at index {index} is: {element}");
} D'éirigh leis an gcód seo a thiomsú. Má ritheann tú an cód seo ag baint úsáide as cargo run agus cuir isteach 0, 1, 2,3, nó 4, priontálfaidh an clár an ceann comhfhreagrach luach ag an innéacs sin san eagar. Má chuireann tú isteach ina ionad sin uimhir thar dheireadh na an eagar, mar 10, feicfidh tú aschur mar seo: thread 'main' panicked at src/main.rs:19:19:
index out of bounds: the len is 5 but the index is 10
note: run with `RUST_BACKTRACE=1` environment variable to display a backtrace Bhí earráid runtime mar thoradh ar an gclár nuair a úsáideadh neamhbhailí luach san oibríocht innéacsaithe. Chuaigh an clár amach le teachtaireacht earráide agus níor rith an ráiteas println! deiridh. Nuair a dhéanann tú iarracht rochtain a fháil ar eilimint ag baint úsáide as innéacsú, seiceálfaidh Rust go bhfuil an t-innéacs a shonraigh tú níos lú ná an fad eagar. Má tá an t-innéacs níos mó ná nó cothrom leis an fad, Beidh meirge scaoll. Caithfidh an tseiceáil seo tarlú ag am rite, go háirithe sa chás seo, mar ní féidir a fhios ag an tiomsaitheoir cén luach a chuirfidh úsáideoir isteach nuair a bheidh sé rith an cód níos déanaí. Is sampla é seo de phrionsabail sábháilteachta cuimhne Rust i ngníomh. I go leor teangacha ísealleibhéil, ní dhéantar seiceáil den chineál seo, agus nuair a chuireann tú seiceáil ar fáil innéacs mícheart, is féidir rochtain a fháil ar chuimhne neamhbhailí. Cosnaíonn meirge tú ina choinne seo cineál earráide trí dhul amach láithreach in ionad an rochtain chuimhne a cheadú agus ag leanúint. Pléann Caibidil 9 níos mó de láimhseáil earráidí Rust agus conas is féidir leat scríobh cód inléite, sábháilte nach scaoll ná nach gceadaíonn rochtain neamhbhailí ar chuimhne.

