Tá feidhmeanna forleithne i gcód Rust. Tá ceann de na cinn is mó feicthe agat cheana féin feidhmeanna tábhachtacha sa teanga: an main, is é sin an iontráil pointe go leor clár. Tá an eochairfhocal fn feicthe agat freisin, a ligeann duit feidhmeanna nua a dhearbhú. Úsáideann cód meirge nathair cás mar ghnáthstíl feidhme agus athróg ainmneacha, ina bhfuil litreacha beaga go léir agus ina gcuirtear béim ar fhocail ar leith. Seo clár ina bhfuil sainmhíniú ar fheidhm shamplach: Ainm comhaid: src/main.rs fn main() { println!("Hello, world!"); another_function();
} fn another_function() { println!("Another function.");
} Sainmhínímid feidhm i Rust trí fn a iontráil agus ainm feidhme agus a sraith lúibíní. Insíonn na lúibíní cuartha don tiomsaitheoir cá bhfuil an fheidhm tosaíonn agus críochnaíonn an comhlacht. Is féidir linn aon fheidhm atá sainithe againn a ghlaoch trína hainm a chur isteach agus sraith ina dhiaidh de lúibíní. Toisc go bhfuil another_function sainmhínithe sa chlár, is féidir é a bheith ar a dtugtar ón taobh istigh den main. Tabhair faoi deara gur shainmhíníomar another_function tar éis an fheidhm main sa chód foinse; d'fhéadfaimis é a shainiú roimhe seo chomh maith. Is cuma le Rust cén áit a shainíonn tú do chuid feidhmeanna, ach amháin go bhfuil siad sainithe áit éigin i raon feidhme atá le feiceáil ag an nglaoiteoir. Cuirimis tús le tionscadal dénártha nua darb ainm functions chun feidhmeanna a iniúchadh a thuilleadh. Cuir an sampla another_function i src/main.rs agus rith é. tu Ba chóir go bhfeicfeadh sé an t-aschur seo a leanas: $ cargo run Compiling functions v0.1.0 (file:///projects/functions) Finished `dev` profile [unoptimized + debuginfo] target(s) in 0.28s Running `target/debug/functions`
Hello, world!
Another function. Feidhmíonn na línte san ord ina bhfuil siad le feiceáil sa main. Ar dtús an "Dia duit, domhan!" priontaí an teachtaireacht, agus ansin tugtar another_function agus tá a theachtaireacht clóbhuailte.

