Ligeann slonn if duit do chód a chraobhscaoileadh ag brath ar choinníollacha. tu cuir coinníoll ar fáil agus ansin luaigh, “Má shásaítear an coinníoll seo, rith an bloc seo de chód. Mura gcomhlíontar an coinníoll, ná rith an bloc cód seo." Cruthaigh tionscadal nua darb ainm branches i d’eolaire projects le fiosrú an abairt if. Sa chomhad src/main.rs , cuir an méid seo a leanas isteach: Ainm comhaid: src/main.rs fn main() { let number = 3; if number < 5 { println!("condition was true"); } else { println!("condition was false"); }
} Tosaíonn gach nathanna if leis an eochairfhocal if, agus coinníoll ina dhiaidh sin. I sa chás seo, seiceálann an riocht cibé an bhfuil nó nach bhfuil ag an number athróg luach níos lú ná 5. Cuirimid an bloc cód a fhorghníomhú má tá an coinníoll true díreach tar éis an riocht taobh istigh de lúibíní curly. Bloic cód a bhaineann leis na coinníollacha i if tugtar arms uaireanta ar na habairtí, díreach cosúil leis na hairm sna habairtí match a phléamar sa “Comparáid an Buille faoi thuairim leis an Uimhir Rúnda” alt de Chaibidil 2. Roghnach, is féidir linn slonn else a chur san áireamh freisin, rud a roghnaigh muid a dhéanamh anseo, chun bloc eile de chód a thabhairt don chlár le forghníomhú má tá an riocht luacháil go false. Mura dtugann tú slonn else agus is é an coinníoll false, ní dhéanfaidh an clár ach an bloc if a scipeáil agus bogadh ar aghaidh go dtí an chéad phíosa eile de chód. Bain triail as an gcód seo a rith; ba cheart duit an t-aschur seo a leanas a fheiceáil: $ cargo run Compiling branches v0.1.0 (file:///projects/branches) Finished `dev` profile [unoptimized + debuginfo] target(s) in 0.31s Running `target/debug/branches`
