} Má reáchtálann tú an cód seo, priontálfar number was something other than zero. Láimhseáil Coinníollacha Il le else if Is féidir leat coinníollacha iolracha a úsáid trí if agus else a chur le chéile i else if léiriú. Mar shampla: Ainm comhaid: src/main.rs fn main() { let number = 6; if number % 4 == 0 { println!("number is divisible by 4"); } else if number % 3 == 0 { println!("number is divisible by 3"); } else if number % 2 == 0 { println!("number is divisible by 2"); } else { println!("number is not divisible by 4, 3, or 2"); }
} Tá ceithre chosán féideartha ag an gclár seo ar féidir leis a ghlacadh. Tar éis é a rith, ba chóir duit féach an t-aschur seo a leanas: $ cargo run Compiling branches v0.1.0 (file:///projects/branches) Finished `dev` profile [unoptimized + debuginfo] target(s) in 0.31s Running `target/debug/branches`
