} Beidh an athróg number ceangailte de réir luach a bheidh bunaithe ar thoradh an if léiriú. Rith an cód seo chun a fheiceáil cad a tharlaíonn: $ cargo run Compiling branches v0.1.0 (file:///projects/branches) Finished `dev` profile [unoptimized + debuginfo] target(s) in 0.30s Running `target/debug/branches`
