} Nuair a dhéanaimid iarracht an cód seo a thiomsú, gheobhaidh muid earráid. Na lámha if agus else tá cineálacha luacha neamh-chomhoiriúnacha acu, agus léiríonn Rust go díreach cá háit le aimsigh an fhadhb sa chlár: $ cargo run Compiling branches v0.1.0 (file:///projects/branches)
