Is minic a bhíonn sé úsáideach bloc cód a rith níos mó ná uair amháin. Don tasc seo, Soláthraíonn Rust roinnt loops , a rithfidh tríd an gcód taobh istigh den lúb comhlacht go dtí deireadh agus ansin tosú láithreach ar ais ag an tús. Chun triail le lúba, déanaimis tionscadal nua darb ainm loops . Tá trí chineál lúb ag Rust: loop, while agus for. Déanaimis iarracht gach ceann acu. Cód á athrá le loop Insíonn an eochairfhocal loop do Rust bloc cód a fhorghníomhú arís agus arís eile go deo nó go dtí go n-insíonn tú go sainráite é stopadh. Mar shampla, athraigh an comhad src/main.rs i do eolaire loops chun breathnú mar seo: Ainm comhaid: src/main.rs fn main() { loop { println!("again!"); }
} Agus an clár seo á rith againn, feicfidh muid again! á phriontáil arís agus arís eile go dtí go stopfaimid an clár de láimh. Tacaíonn an chuid is mó de na críochfoirt leis an aicearra méarchláir ctrl - c chun cur isteach ar ríomhchlár atá i bhfostú go leanúnach lúb. Bain triail as: $ cargo run Compiling loops v0.1.0 (file:///projects/loops) Finished `dev` profile [unoptimized + debuginfo] target(s) in 0.08s Running `target/debug/loops`
again!
