again!
again!
^Cagain! Léiríonn an tsiombail ^C an áit ar bhrúigh tú ctrl - c. tu b'fhéidir nó b'fhéidir nach bhfeicfidh sé an focal again! i gcló tar éis an ^C, ag brath ar an áit bhí an cód sa lúb nuair a fuair sé an comhartha idirbhriste. Go fortunately, soláthraíonn Rust bealach freisin chun briseadh amach as lúb ag baint úsáide as cód. tu Is féidir leis an eochairfhocal break a chur laistigh den lúb chun a insint don chlár cathain a stopfaidh sé an lúb a fhorghníomhú. Thabhairt chun cuimhne go ndearna muid é seo sa chluiche buille faoi thuairim sa “Ag Scoir Tar éis Buille Cheart” alt de Chaibidil 2 a fhágáil ar an gclár nuair a bhuaigh an t-úsáideoir an cluiche trí an uimhir cheart a thomhas. Bhaineamar úsáid freisin as continue sa chluiche buille faoi thuairim, rud a insíonn an clár i lúb chun dul thar aon chód atá fágtha san atriall seo den lúb agus téigh go dtí an an chéad atriall eile. Luachanna Ag Filleadh ó Lúbanna Ceann de na húsáidí a bhaineann le loop is ea triail eile a bhaint as oibríocht a bhfuil a fhios agat go bhféadfadh go dteipfeadh uirthi, mar sin le seiceáil an bhfuil a phost críochnaithe ag snáithe. Seans go mbeidh ort pas a fháil freisin toradh na hoibríochta sin amach as an lúb go dtí an chuid eile de do chód. A dhéanamh seo, is féidir leat an luach a theastaíonn uait a chur ar ais tar éis an slonn break tú úsáid chun an lúb a stopadh; cuirfear an luach sin ar ais as an lúb ionas gur féidir leat bain úsáid as, mar a thaispeántar anseo: fn main() { let mut counter = 0; let result = loop { counter += 1; if counter == 10 { break counter * 2; } }; println!("The result is {result}");
} Roimh an lúb, dearbhaímid athróg darb ainm counter agus cuirimid tús leis 0. Ansin dearbhaímid athróg darb ainm result chun an luach a tugadh ar ais uaidh a choinneáil an lúb. Ar gach atriall den lúb, cuirimid 1 leis an athróg counter, agus ansin seiceáil an bhfuil an counter cothrom le 10. Nuair a bhíonn sé, úsáidimid an eochairfhocal break leis an luach counter * 2. Tar éis an lúb, úsáidimid a leathstad chun deireadh a chur leis an ráiteas a sannann an luach do result. Ar deireadh, táimid priontáil an luach i result, atá sa chás seo 20. Is féidir leat return ón taobh istigh de lúb freisin. Cé nach n-imíonn break ach as an sruth lúb, fágann return an fheidhm reatha i gcónaí. Lipéid Lúb le Díréimniú Idir lúbanna Il Má tá lúba laistigh de lúba agat, beidh feidhm ag break agus continue ar aghaidh chuig an gceann is faide istigh lúb ar an bpointe sin. Is féidir leat loop label a shonrú go roghnach ar lúb a is féidir leat a úsáid ansin le break nó continue chun a shonrú go bhfuil na heochairfhocail cuir i bhfeidhm ar an lúb lipéadaithe in ionad na lúb is faide istigh. Ní mór tús a chur le lipéid lúb le ceanglófar amháin. Seo sampla le dhá lúb neadaithe: fn main() { let mut count = 0; 'counting_up: loop { println!("count = {count}"); let mut remaining = 10; loop { println!("remaining = {remaining}"); if remaining == 9 { break; } if count == 2 { break 'counting_up; } remaining -= 1; } count += 1; } println!("End count = {count}");
} Tá an lipéad 'counting_up' ar an lúb seachtrach, agus comhairfidh sé suas ó 0 go 2. Comhaireamh an lúb istigh gan lipéad síos ó 10 go 9. An chéad break sin Ní shonraítear lipéad scoirfidh sé den lúb inmheánach amháin. An break 'counting_up; scoirfidh ráiteas an lúb seachtrach. Priontálann an cód seo: $ cargo run Compiling loops v0.1.0 (file:///projects/loops) Finished `dev` profile [unoptimized + debuginfo] target(s) in 0.58s Running `target/debug/loops`
