End count = 2 Lúb Choinníollach le while Is minic go gcaithfidh clár riocht laistigh de lúb a mheas. Cé go bhfuil an Tá an coinníoll true, ritheann an lúb. Nuair a scoireann an riocht de bheith true, beidh an Glaonn an clár break, ag stopadh an lúb. Is féidir iompar a chur i bhfeidhm mar seo ag baint úsáide as meascán de loop, if, else, agus break; d'fhéadfadh tú bain triail as sin anois i gclár, más mian leat. Mar sin féin, tá an patrún seo chomh coitianta go bhfuil tógáil teanga ionsuite ag Rust dó, ar a dtugtar lúb while. I Ag liostú 3-3, bainimid úsáid as while chun an clár a lúbadh trí huaire, ag comhaireamh síos gach ceann acu am, agus ansin, tar éis an lúb, a phriontáil teachtaireacht agus scoir. fn main() { let mut number = 3; while number != 0 { println!("{number}!"); number -= 1; } println!("LIFTOFF!!!");
} Cuireann an tógáil seo deireadh le go leor neadaithe a bheadh riachtanach dá mbainfeá úsáid as loop, if, else, agus break, agus tá sé níos soiléire. Cé go coinníoll meastóireacht go true, ritheann an cód; ar shlí eile, scoireann sé an lúb. Ag dul trí Bhailiúchán le for Is féidir leat an tógáil while a úsáid freisin chun na heilimintí de a bhailiú, mar shampla eagar. Mar shampla, priontaí an lúb i Liostú 3-4 an ceann eilimint san eagar a. fn main() { let a = [10, 20, 30, 40, 50]; let mut index = 0; while index < 5 { println!("the value is: {}", a[index]); index += 1; }
} Anseo, déantar an cód a chomhaireamh trí na heilimintí san eagar. Tosaíonn sé ag innéacs 0, agus lúbann sé ansin go dtí go sroicheann sé an t-innéacs deiridh san eagar (is é sin, nuair nach bhfuil index < 5 a thuilleadh true). Má ritheann tú an cód seo, déanfar gach eilimint san eagar: $ cargo run Compiling loops v0.1.0 (file:///projects/loops) Finished `dev` profile [unoptimized + debuginfo] target(s) in 0.32s Running `target/debug/loops`
the value is: 10
the value is: 20
the value is: 30
the value is: 40
the value is: 50 Tá na cúig luach eagair ar fad le feiceáil sa teirminéal, mar a bhíothas ag súil leis. Cé go bhfuil index Beidh teacht ar luach 5 ag pointe éigin, stopann an lúb forghníomhaitheach roimh iarraidh an séú luach a fháil ón eagar. Mar sin féin, tá an cur chuige seo seans maith go hearráidí; d’fhéadfaimis scaoll a chur ar an gclár dá mba rud é tá an luach innéacs nó an riocht tástála mícheart. Mar shampla, má d'athraigh tú an sainmhíniú ar an eagar a a bheith ceithre eilimint ach dearmad a thabhairt cothrom le dáta an coinníoll go while index < 4, bheadh an cód scaoll. Tá sé mall freisin, mar gheall ar cuireann an tiomsaitheoir cód ama rite leis chun an tseiceáil choinníollach a dhéanamh an bhfuil an tá an t-innéacs laistigh de theorainneacha an eagar ar gach atriall tríd an lúb. Mar rogha eile níos gonta, is féidir leat lúb for a úsáid agus cód éigin a fhorghníomhú do gach earra i mbailiúchán. Breathnaíonn lúb for cosúil leis an gcód i Liostú 3-5. fn main() { let a = [10, 20, 30, 40, 50]; for element in a { println!("the value is: {element}"); }
} Agus an cód seo á rith againn, feicfidh muid an t-aschur céanna agus atá i Liostú 3-4. Tuilleadh rud is tábhachtaí, táimid tar éis sábháilteacht an chóid a mhéadú anois agus deireadh a chur le seans fabhtanna a d'fhéadfadh a bheith mar thoradh ar dhul níos faide ná deireadh na sraithe nó nach bhfuil ag dul fada go leor agus roinnt míreanna ar iarraidh. Ag baint úsáide as an lúb for, ní bheadh ort cuimhneamh ar aon chód eile a athrú más rud é d'athraigh tú líon na luachanna san eagar, mar a dhéanfá leis an modh a úsáidtear i Liosta 3-4. Mar gheall ar shábháilteacht agus beacht na lúb for is iad an lúb is coitianta a úsáidtear Tógáil i Rust. Fiú i gcásanna inar mian leat a rith roinnt cód a líon áirithe uaireanta, mar atá sa sampla comhaireamh síos a d'úsáid lúb while i Liosta 3-3, d'úsáidfeadh formhór na Rustaceans lúb for. An bealach chun é sin a dhéanamh úsáid a bhaint as Range, a sholáthraíonn an leabharlann chaighdeánach, a ghineann gach uimhir in ord ag tosú ó uimhir amháin agus ag críochnú roimh uimhir eile uimhir. Seo an chuma a bheadh ar an gcomhaireamh síos ag baint úsáide as lúb for agus modh eile níor labhair muid faoi go fóill, rev, chun an raon a aisiompú: Ainm comhaid: src/main.rs fn main() { for number in (1..4).rev() { println!("{number}!"); } println!("LIFTOFF!!!");
} Tá an cód seo beagán níos deise, nach ea?
